        }
    }
    for (int i = 0; i < 4; ++i) {
        for (int z = 0; z < 3; ++z) {
            for (int j = 3; j >= 1; --j) {
                if (arr[j][i] == 0 && arr[j-1][i] != 0){
                    swap(arr[j][i], arr[j-1][i]);
                }
            }
        }
    }
}

