int do_we_have_free_place(vector<vector<int>>& arr){
    for (int i = 0; i < 4; ++i) {
        for (int j = 0; j < 4; ++j) {
            if (arr[i][j] == 0)
                return true;
        }
    }
    return false;
}

int is_not_finish(vector<vector<int>>& arr){
    for (int i = 0; i < 3; ++i) {
        if (arr[0][i] == arr[0][i+1])
            return true;
        if (arr[i][0] == arr[i+1][0])
            return true;
        if (arr[2-i][0] == arr[3-i][0])
            return true;
        if (arr[0][2-i] == arr[0][3-i])
            return true;
    }
    for (int i = 1; i < 3; ++i) {
        for (int j = 1; j < 3; ++j) {
            if (arr[i][j] == arr[i-1][j])
                return true;
            if (arr[i][j] == arr[i+1][j])
                return true;
            if (arr[i][j] == arr[i][j-1])
                return true;
            if (arr[i][j] == arr[i][j+1])
                return true;
        }
    }
    if (do_we_have_free_place(arr))
        return true;
    return false;
}

int getRandomNumber(int min, int max)
{
    static const double fraction = 1.0 / (static_cast<double>(RAND_MAX) + 1.0);
    return static_cast<int>(rand() * fraction * (max - min + 1) + min);
}

int random_2_or_4(){
    int returner = getRandomNumber(1,2);
    if (returner == 1)
        returner = 4;
    return returner;
}
void poyavlenie(vector<vector<int>>& arr){
    int sum_free = 0;
    for (int i = 0; i < 4; ++i) {
        for (int j = 0; j < 4; ++j) {
            if (arr[i][j] == 0)
                sum_free++;
        }
    }
    int random_number = getRandomNumber(0,sum_free);
    int nulls = 0;
    for (int i = 0; i < 4; ++i) {
        for (int j = 0; j < 4; ++j) {
            if (arr[i][j] == 0)
                nulls++;
            if (nulls == random_number){
                arr[i][j] = random_2_or_4();
                return;
            }
        }
    }
}

